import React from 'react';

const SpotifyEmbed = () => (
  <iframe
    style={{ borderRadius: '12px' }}
    src="https://open.spotify.com/embed/album/5QqqBZmdQmY1MvlnpBkagB?utm_source=generator&theme=0"
    width="50%"
    height="352"

    allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"
    loading="lazy"
    allowFullScreen
    title="Spotify Embed"
  ></iframe>
);

export default SpotifyEmbed;
